import React from 'react';
import '../css/AiMl.css';

function AiMl() {
    return (
        <div className="ai-ml">
        <h1>AI/ML</h1>
        <div>
            <p>MyApp is a learning platform that helps people learn programming and AI.</p>
            <p>Our mission is to make learning programming and AI accessible to everyone.</p>
            <p>Our vision is to be the leading learning platform for programming and AI.</p>
        </div>
        </div>
    );
}

export default AiMl;
